  render() {
    return (
      <div>
        <AddAccount /> <br/>
        <div className="container">
          <div className='card card-header'>
            <h2>
              <i className='fas fa-pen'>&nbsp;&nbsp;</i>Edit account
            </h2>
          </div>
          <div className='card card-body'>
          </div>
        </div>
      </div>
    )
  }
}

export default connect(null, null)(ManageAccounts);
